 20 miles south of the Canadian border, said New York State police.\n\nTo read the full story and others, visit http://www.abcnews.com\n\nFollow ABC News across the web!\nFacebook: http://www.facebook.com/abcnews \nTwitter: http://twitter.com/ABC\nInstagram: https://instagram.com/ABCNews/ \n\nWatch as criminal investigations unfold, and witness the technology that helps the real life crime scene investigations (CSI) bring criminals to justice. Watch the stories of ordinary crime and the work of criminal masterminds. Advance through the justice system and the aftermath that follows a high profile investigation. From the start to finish ABC News is your source for the breaking stories of the rising crime rate in our nation. Stay informed on the latest crime news with abcnews.com.\n\nABC World News Tonight \nABC World News Tonight provides the American public the latest news and analysis of major events within our country as well as around the globe. With unparalleled resources ABC News and World News clarifies the days top stories, keeping viewers up to date and informed, every weekend night. Check out the award winning team of off-air reporters, correspondents, and producers of ABC World News Tonight weekend nights at 6:30 | 5:30c. \n\nABC News \nMake ABC News your daily news outlet for breaking national and world news, broadcast video coverage, and exclusive interviews that will help you stay up to date on the events shaping our world. ABC News show roster has both leaders in daily evening and morning programming. Kick start your weekday mornings with news updates from Good Morning America (GMA) and Sundays with This Week with George Stephanopoulos. Get your evening fix with 20/20, Nightline, and ABC World News Tonight. Head to abc.go.com for programming schedule and more information on ABC News.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/AXQZQxIYqN0/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs  Sweat were accounted for during a morning bed check at the Clinton Correctional Facility in Dannemora, about 20 miles south of the Canadian border, said New York State police.\n\nTo read the full story and others, visit http://www.abcnews.com\n\nFollow ABC News across the web!\nFacebook: http://www.facebook.com/abcnews \nTwitter: http://twitter.com/ABC\nInstagram: https://instagram.com/ABCNews/ \n\nWatch as criminal investigations unfold, and witness the technology that helps the real life crime scene investigations (CSI) bring criminals to justice. Watch the stories of ordinary crime and the work of criminal masterminds. Advance through the justice system and the aftermath that follows a high profile investigation. From the start to finish ABC News is your source for the breaking stories of the rising crime rate in our nation. Stay informed on the latest crime news with abcnews.com.\n\nABC World News Tonight \nABC World News Tonight provides the American public the latest news and analysis of major events within our country as well as around the globe. With unparalleled resources ABC News and World News clarifies the days top stories, keeping viewers up to date and informed, every weekend night. Check out the award winning team of off-air reporters, correspondents, and producers of ABC World News Tonight weekend nights at 6:30 | 5:30c. \n\nABC News \nMake ABC News your daily news outlet for breaking national and world news, broadcast video coverage, and exclusive interviews that will help you stay up to date on the events shaping our world. ABC News show roster has both leaders in daily evening and morning programming. Kick start your weekday mornings with news updates from Good Morning America (GMA) and Sundays with This Week with George Stephanopoulos. Get your evening fix with 20/20, Nightline, and ABC World News Tonight. Head to abc.go.com for programming schedule and more information on ABC News."},"lengthSeconds":"410","ownerProfileUrl":"http://www.youtube.c
